import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";

function About() {
    return (
        <Container className="page">
      <div id="about">
        <h2>A PROPOS DE MOI</h2>
        <br></br>
        <br></br>
        <p>Nom: Mariam Ghukasyan</p>
        <p>Date de naissance: 13 mai 1995</p>
        <p>Email: mariam1.ghukasyan@epitech.eu</p>
        <p>Téléphone: 06 20 80 63 26</p>
        <p>Adresse: 1 Rue Guillaume Apollinaire, 94800 VILLEJUIF</p>
        <p>
          " Méthodique et rigoureuse... J'ai depuis toujours été attiré par
          l'informatique et ses nombreux dérivés. Travailleuse depuis mes 18ans,
          j'ai pu rejoindre Epitech Paris en Novembre 2020 pour la formation
          WAC. C'est une formation de 2ans, très intensive, donnant lieu à une
          multitudes de projets dans le but de devenir développeur Full-Stack,
          et je suis déterminée à atteindre cet objectif. "
        </p>
        <br></br>
        <br></br>
      </div>
      </Container>
    );
  }

export default About;
